import React from 'react'
import CartItem from './CartItem'

const ShoppingCart = ( props) => {


  return (
    <div className="cart">
      <h2>Your Cart</h2>
      <div>
        {props.cart.map(item =>(
          <CartItem key={item.id} item={item} />
        ))}
      </div>
    </div>
  )
}

export default ShoppingCart;
